    { imgPath: 'img3', title: 'Cksachdev' },
    { imgPath: 'img4', title: 'Undemsem' },
    { imgPath: 'img4', title: 'Pauloesantos' },
    { imgPath: 'img4', title: 'Arthu' },
    { imgPath: 'img4', title: 'Wxqfree' }
]
function Title(props) {
    return (
        <div className='page'>
            <h1>Pagination</h1>
            <div className='underline'></div>
